}

PREFIX fb: <http://rdf.freebase.com/ns/>
SELECT ?employer ?from ?to WHERE {
  fb:m.019fz fb:people.person.employment_history ?employment .
  ?employment fb:business.employment_tenure.company ?employer .
  OPTIONAL {
    ?employment fb:business.employment_tenure.from ?from
  }
