PREFIX fb: <http://rdf.freebase.com/ns/>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
SELECT ?child ?childLabel ?birthplace ?birthplaceLabel WHERE {
  {
    fb:m.0dbzg fb:people.person.children ?child .
  } UNION {
    fb:m.01vwyqp fb:people.person.children ?child .
  }
  .
  ?child rdfs:label ?childLabel FILTER ( LANG( ?childLabel ) = 'en' ) .
  OPTIONAL {
    ?child fb:people.person.place_of_birth ?birthplace .
    ?birthplace rdfs:label ?birthplaceLabel
    FILTER ( LANG( ?birthplaceLabel ) = 'en' )
  }
}
ORDER BY ?childLabel

